import React, { useEffect, useState } from "react";

function DashboardPage() {
  const [data, setData] = useState({});
  useEffect(
    () =>
      fetch("admin_routes")
        .then((res) => res.json())
        .then((d) => setData(d)),
    []
  );
  return <div>Dashboard</div>;
}

export default DashboardPage;
